import { createRouter, createWebHistory } from 'vue-router'
import ParticipantDashboard from './src/views/ParticipantDashboard.vue'
import CollaborativeDecrypt from './src/views/CollaborativeDecrypt.vue'
import OnlineStatusPage from './src/views/OnlineStatusPage.vue'

const routes = [
  { path: '/', component: ParticipantDashboard },
  { path: '/collaborative', component: CollaborativeDecrypt },
  { path: '/online', component: OnlineStatusPage }
]

export default createRouter({
  history: createWebHistory(),
  routes
})
